import { useState } from 'react'
import Projects from './Projects.json'

const Project = () => {
    const [projects, setProjects] = useState([])

    return(
        <div>
            <h1>projects</h1>
            {
                    setProjects(Projects)
                    // console.log(projects);                
            }
        </div>
    )
}

export default Project
